          <Route exact path='/signup' element={<SignupForm/>}></Route>
          <Route exact path='/login' element={<LoginForm/>}></Route>
          <Route exact path='/products' element={<AllProducts/>}></Route>
          <Route exact path='/cart' element={<Cart/>}></Route>
        </Routes>
        <Footer/>
      </BrowserRouter>
    </React.Fragment>
  );
}

export default App;
